import React, { setState } from 'react';
import CONFIG from 'config';
import parse from 'html-react-parser';
import { makeStyles } from '@material-ui/core/styles';
import { AppBar, Toolbar, Typography, Button, IconButton } from '@material-ui/core';
import MenuIcon from '@material-ui/icons/Menu';

import { logoutUser as logoutUserUtil } from 'utils/accountUtil/accountUtil';
import TopNavMenu from 'components/TopNavMenu/TopNavMenu';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
  },
}));

const TopNavBar = () => {
  const classes = useStyles();
  const [openMenu, setOpenMenu] = setState(false);

  const toggleMenu = () => {
    setOpenMenu(!openMenu);
  };

  return (
    <div className={classes.root}>
      <AppBar
        position="static"
        color="primary"
        component="nav"
      >
        <Toolbar>
          <IconButton
            edge="start"
            className={classes.menuButton}
            color="inherit"
            aria-label="menu"
            onClick={toggleMenu}
          >
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" className={classes.title}>
            {parse(CONFIG.APP_NAME)}
          </Typography>
          <Button
            color="inherit"
            onClick={logoutUserUtil}
          >
            Log Out
          </Button>
        </Toolbar>
      </AppBar>
    </div>
  );
};

export default TopNavBar;
